                            Plotly.newPlot(
                             plotDiv, detail, {responsive: true});
                            backButton.style.display = 'block';
                            plotDiv.removeAllListeners('plotly_click');
                        }
                    });
                }

                showMain();
            </script>
        </body>
        </html>
